import FormSelect from '../components/select'

import styled from 'styled-components'
import '../styles/theme.css'

function FilterApps() {
  const AppOptions = [
    { value: 'app1', label: 'App1' },
    { value: 'app2', label: 'App2' },
    { value: 'app3', label: 'App3' },
  ]

  const ProjectOptions = [
    { value: 'foodfight', label: 'foodfight' },
    { value: 'project', label: 'project' },
    { value: 'admin-portal', label: 'admin-portal' },
    { value: 'help-center', label: 'help-center' },
    { value: 'vendors', label: 'vendors' },
    { value: 'recs', label: 'recs' },
    { value: 'payments', label: 'payments' },
    { value: 'foodfightiOS', label: 'foodfightiOS' },
    { value: 'foodfightDroid', label: 'foodfightDroid' },
  ]

  const EnvOptions = [
    { value: 'all', label: 'All Env' },
    { value: 'prod', label: 'prod' },
    { value: 'stag', label: 'stag' },
  ]

  const DateOptions = [
    { value: '24h', label: '24h' },
    { value: '14d', label: '14d' },
  ]

  return (
    <FilterAppsStyles>
      <AppFormSelect 
        defaultValue={AppOptions[0]}
        options={AppOptions}
      />
      <EnvFormSelect 
        defaultValue={EnvOptions[0]}
        options={EnvOptions}
      />
      <DateFormSelect 
        defaultValue={DateOptions[0]}
        options={DateOptions}
      />
    </FilterAppsStyles>
  )
}

const FilterAppsStyles = styled('div')`
  display: flex;
`;

const AppFormSelect = styled(FormSelect)`
  .react-select__control {
    border-radius: var(--radius) 0 0 var(--radius);
  }
`;

const EnvFormSelect = styled(FormSelect)`
  .react-select__control {
    border-radius: 0;
    border-left: 0;
    border-right: 0;
  }
`;

const DateFormSelect = styled(FormSelect)`
  .react-select__control {
    border-radius: 0 var(--radius) var(--radius) 0;
  }
`;

export default FilterApps;
